import React from "react";

const styles = {
    color: '#f6dde8',
    display: "flex", 
    justifyContent: "flex-end"
}
const Navigation = () => {
  return (
    <nav style={styles} className='justify-around'>
      <p 
    //   className='mr5-ns mr1'
      >About</p>
      <p>Portfolio</p>
    </nav>
  );
};

export default Navigation;
